import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate the price filter section to ensure it's visible
    await page.waitForSelector('.price-filter');

    // Enter the minimum price
    const minPriceInput = page.locator('.price-input').first();
    await minPriceInput.fill('50');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_min_price_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_min_price_entered.png'));

    // Enter the maximum price
    const maxPriceInput = page.locator('.price-input').nth(1);
    await maxPriceInput.fill('150');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_max_price_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_max_price_entered.png'));

    // Click the "Apply" button
    await page.locator('.apply-filter').click();

    // Take a final screenshot to show the state after applying the filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_filter_applied.png'));

    // Extract the values to verify the action
    const extractedMinPrice = await minPriceInput.inputValue();
    const extractedMaxPrice = await maxPriceInput.inputValue();

    return {
      success: true,
      action: "Successfully applied a price range filter from 50 to 150.",
      extractedData: {
        minPrice: extractedMinPrice,
        maxPrice: extractedMaxPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
